import React, { useEffect, useState } from "react";
import {Link } from "react-router-dom";

export const List = () => {
  const [timesheets, setTimesheets] = useState([]);
  useEffect(() => {
    fetch("http://localhost:3000/api/timesheets", {

    // Need to ensure the data is not an array and should do a catch block here

    method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    })
      .then((response) => {
        return response.json();
      })
      .then((timesheets) => {
        console.log("timesheets:", timesheets);
        setTimesheets(timesheets)}).catch(() => console.log());
  }, []);
  return (
    <div>

      <h1>Timesheets</h1>
      <ul>
        {timesheets.map((el, index) => (
          <ul
            key={index}
          >
            <Link to={`timesheet/edit/${el.id}`}>{el.client} </Link>
          </ul>
        ))}
      </ul>
    </div>
  );
};
